import axios from "axios";
import httpAdapter from "axios/lib/adapters/http";

axios.defaults.adapter = xhrAdapter;

const Axios = axios.create({
  baseURL: "http://localhost:8080/api",
  adapter: httpAdapter,
});

export default Axios;
